import './App.css';
import NavBar from './components/NavBar/navbar';
import UpperBody from './components/UpperBody/upperbody';
import LowerBody from './components/LowerBody/lowerbody';
import { Router } from 'react-router';

function App() {
  return (
    <div className="App">
    <Router>
      <NavBar />
       <UpperBody />
      {/* <Search /> */}
      <LowerBody />
      {/* <ServiceCards /> */}
      </Router>
    </div>
  );
}

export default App;
